import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./pages/Login";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" elemen={<Login />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
